●ワイヤー入りで、瞬時にパッと広がり、<br>収納時はコンパクトに折りたたむことができるサンシェードです。<BR><br>●紫外線で色が変わるビーズ付き。紫外線の有無を知らせます。<BR><br>●クリップ付きなので簡単にお車のグリップやベビーカーに取り付けできます。<BR><br>●アームは角度調節が自在にできます。<br><br><br>メーカー：ナポレックス<br>品番：BD-122<style type="text/css">
