【特長】<br>ノーマル生地とメッシュ生地の2枚仕立てのカーテンです。<br><br>内側は遮光性に優れたノーマル生地、外側は視認性に優れたメッシュ生地です。<br><br>付属のピラーステーにヒモストッパを取り付けるだけで簡単に取り付け、取外しが可能です。<br><br>吸盤で窓に貼り付けるだけの超簡単取付けです。<br><br>窓枠とカーテンの間にできてしまう、すき間がなく、キレイに取付けできます。<br><br>未使用時が小さくたたんで収納できます。<br><br>【メーカー】<br>ミラリード<br><br>【品番】<br>EC13-02<br><style type="text/css">
